export const COLUMNS = [
    {
        Header: 'Name',
        accessor: 'name',      
        disableSortBy: true 
    },
    {
        Header: 'Description',
        accessor: 'description',
        disableSortBy: true
    },
    {
        Header: 'Price',
        accessor: 'initial_price',
        disableGlobalFilter: true
    }
]
